import Button from "../Button/Button";


interface FormProps {

    heading: string
    buttonText : string

}


const FormBox: React.FC<FormProps> = ({heading,buttonText}) => {
    return (

        <section className="flex flex-col items-center shadow-xl h-2/4 p-10 rounded">

            
            <h3 className="text-heading-blue-800 text-3xl font-bold">Entre na sua conta</h3>

            <form className="w-full" action="#" method="POST">

                <Button text = "Login" />

            </form>

            



        </section>
        
    );
}

export default FormBox;
